import React, {Component} from 'react';


class Nav extends Component {
    render(){
        return (
            <nav className="container">
                <Logo />>
                <div className= 'nav-content'>
                    <span class="desktop-only" id="registrations-nav-link">Home</span>
                    <span class="desktop-only" id="registrations-nav-link">Events</span>
                    <span class="desktop-only" id="registrations-nav-link">Organising Committe</span>
                    <span class="desktop-only" id="registrations-nav-link">Previous Sponsors</span>
                    <span class="desktop-only" id="registrations-nav-link">Contact Us</span>
                </div>
            </nav>
        );
    }
}
export default Nav;
